import '../css/nav.css'
import logo from '../images/appa_logo.png'

const Navbar = () => {
    return ( 
        <div className="nav-box">
            <div className="img-row">
                <div className="logo-box">
                    <img src={logo} alt="" />   
                </div>
                <div className="text-box">
                        <p> Archbishop Porter Past </p>
                        <p> Students Association </p>
                    </div>

            </div>

        </div> 
    );
}

export default Navbar;
